import React from 'react';

export default function About() {
  return (
    <div className="container p-5">
      <h2>About Us</h2>
      <p>
        CleanSwift is dedicated to making your home and office shine. With years of experience and a
        trained staff, we provide eco-friendly and efficient cleaning services in your city.
      </p>
      <img
        src="https://cdn.pixabay.com/photo/2016/11/23/00/37/cleaning-1850011_1280.jpg"
        className="img-fluid rounded mt-3"
        alt="Team"
      />
    </div>
  );
}
